import React from "react";

const freelancers = [
  {
    id: 1,
    name: "John Doe",
    skill: "Web Developer",
    price: "$20/hr"
  },
  {
    id: 2,
    name: "Sarah Smith",
    skill: "UI/UX Designer",
    price: "$25/hr"
  },
  {
    id: 3,
    name: "David Lee",
    skill: "Java Developer",
    price: "$30/hr"
  }
];

function Home() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Find Freelancers üë©‚Äçüíª</h1>

      <div style={styles.container}>
        {freelancers.map((f) => (
          <div key={f.id} style={styles.card}>
            <h2>{f.name}</h2>
            <p><b>Skill:</b> {f.skill}</p>
            <p><b>Price:</b> {f.price}</p>

            <button style={styles.button}>
              Hire
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    gap: "20px",
    flexWrap: "wrap"
  },
  card: {
    border: "1px solid #ccc",
    padding: "15px",
    width: "200px",
    borderRadius: "10px",
    boxShadow: "0 2px 5px rgba(0,0,0,0.2)"
  },
  button: {
    background: "#007bff",
    color: "white",
    border: "none",
    padding: "8px 12px",
    cursor: "pointer",
    borderRadius: "5px"
  }
};

export default Home;
